import React, { useEffect, useState } from "react";
import {
  _saveJson,
  _saveReviewsJson,
  _getPlacesLists,
  _delPlace,
} from "../../util/req";

export default function Index() {
  const [list, setList] = useState([]);
  const [infoForm, setInfoForm] = useState({
    username: "",
    password: "",
  });

  const gelist = async () => {
    var res = await _getPlacesLists();
    setList(res.data);
  };
  const del = async (id) => {
    await _delPlace(id);
    alert("ok");
    gelist();
  };
  const save = async () => {
    if (infoForm._id) {
      // await _update(infoForm);
    } else {
      // await _reg(infoForm);
    }
    alert("ok");
    gelist();
    setInfoForm({ username: "", password: "" });
  };
  const update = async (it) => {
    setInfoForm({ ...it });
  };
  const created = async (it) => {
    await _saveJson()
    await _saveReviewsJson()
    alert('ok')
  };

  useEffect(() => {
    gelist();
  }, []);

  return (
    <div className="info-center">
      <br />
      <br />
      <p>
        <button type="button" onClick={created}>
          refesh data for API
        </button>
      </p>
      <br />
      <br />
      <form>
        <p>
          username:{" "}
          <input
            type="text"
            value={infoForm.username}
            onChange={(e) => {
              setInfoForm({ ...infoForm, username: e.target.value });
            }}
          />
        </p>
        <p>
          password:{" "}
          <input
            type="text"
            value={infoForm.password}
            onChange={(e) => {
              setInfoForm({ ...infoForm, password: e.target.value });
            }}
          />
        </p>
        <p>
          <button type="button" onClick={save}>
            {infoForm._id ? "Save" : "Create"}
          </button>
        </p>
      </form>

      <br />
      <br />

      <table>
        <thead>
          <tr>
            <th>name</th>
            <th>rating</th>
            <th>user_ratings_total</th>
            <th>formatted_phone_number</th>
            <th>website</th>
            <th>formatted_address</th>
            <th>action</th>
          </tr>
        </thead>
        <tbody>
          {list.map((it, index) => (
            <tr key={index}>
              <td>{it.name}</td>
              <td>{it.rating}</td>
              <td>{it.user_ratings_total}</td>
              <td>{it.formatted_phone_number}</td>
              <td>{it.website}</td>
              <td>{it.formatted_address}</td>
              <td>
                <button onClick={() => update(it)}>Update</button>
                <button onClick={() => del(it._id)}>Del</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
